class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        i = 0
        j = 0
        max_len = 0
        while i < len(s) and j < len(s):
            #   移动j（拉长子串长度）
            j += 1
            s_str = s[i:j]
            #   通过检测的记录长度
            if self.checkCharRepeat(s_str):
                if len(s_str) > max_len:
                    max_len = len(s_str)
            #   未通过检测的将i移动一位
            else:
                i += 1
        return max_len

    #   判断自身字符是否无重复 false有重复 true无重复
    def checkCharRepeat(self, t_s: str) -> bool:
        for j in range(0, len(t_s)):
            if t_s[j] in (t_s[:j] + t_s[j + 1:]):
                return False
        return True


